import { Appwrite } from 'appwrite';

const sdk = new Appwrite();

sdk
  .setEndpoint('https://cloud.appwrite.io/v1') // Your Appwrite Endpoint
  .setProject('66966dc4001998c933d7'); // Your project ID

export default sdk;
